template<class DataType>
unique_ptr<DataType[]>
Tensor_Sorter::Tensor_Sorter<DataType>::reorder_tensor_data(const DataType* orig_data,  size_t data_size,
                                                  shared_ptr<vector<int>>  new_order_vec ,
                                                  shared_ptr<vector<size_t>>  old_order_range_lengths ) {
/////////////////////////////////////////////////////////////////////////////////////////////////////////////

  const DataType fac1= 1.0;
  const DataType fac2= 1.0;

  int nbase = new_order_vec->size();
  int id_num = 0;
  for (int ii = 0; ii!=new_order_vec->size(); ii++)
    id_num+= pow(nbase, ii)*new_order_vec->at(ii); 

  unique_ptr<DataType[]> reordered_data(new DataType[data_size]);
 
  return reordered_data;
}

///////////////////////////////////////////////////////////////////////////////////////////////////////////////
template<class DataType>
std::string Tensor_Sorter::Tensor_Sorter<DataType>::get_comb_str(shared_ptr<vector<size_t>> invec){
///////////////////////////////////////////////////////////////////////////////////////////////////////////////

   std::string comb_name = " [ " ;
   for ( size_t xx : *invec )
     comb_name += to_string(xx) + " " ;
   comb_name += "]" ;

   return comb_name ;
}

///////////////////////////////////////////////////////////////////////////////////////////////////////////////
template<class DataType>
std::string Tensor_Sorter::Tensor_Sorter<DataType>::get_comb_str(array<int,4>&  sort_options){
///////////////////////////////////////////////////////////////////////////////////////////////////////////////

   std::string comb_name = " [ " ;
   for ( int xx : sort_options )
     comb_name += to_string(xx) + " " ;
   comb_name += "]" ;

   return comb_name ;
}

///////////////////////////////////////////////////////////////////////////////////////////////////////////////
template<class DataType>
size_t Tensor_Sorter::Tensor_Sorter<DataType>::get_perm_idnum(shared_ptr<vector<size_t>> seq) {
///////////////////////////////////////////////////////////////////////////////////////////////////////////////
  
   int base = seq->size();
   int idnum = 0;
   
   for ( int ii = 0 ; ii != seq->size() ; ii++)  
     idnum += pow(base, seq->size()-1-ii)*seq->at(ii);

   return idnum ;
}

///////////////////////////////////////////////////////////////////////////////////////////////////////////////
template<class DataType>
size_t Tensor_Sorter::Tensor_Sorter<DataType>::get_sort_options_idnum(array<int,4>& sort_options) {
///////////////////////////////////////////////////////////////////////////////////////////////////////////////
 
 size_t idnum =0; 
 for ( int ii = 0 ; ii != 4 ; ii++)  
   idnum += pow(4, ii)*(sort_options[ii]+1);

 return idnum ;
}
////////////////////////////////////////////////////////////////////////////////////////////////////////////////
template<typename DataType>
void Tensor_Sorter::Tensor_Sorter<DataType>::sort_indices_2( std::shared_ptr<std::vector<size_t>> new_id_order,
                                                            std::shared_ptr<std::vector<size_t>> rlen,
                                                            std::array<int,4>& sort_options, 
                                                            const DataType* in, DataType* out ) {
////////////////////////////////////////////////////////////////////////////////////////////////////////////////

  size_t sort_options_id = get_sort_options_idnum( sort_options ) ; 
  size_t perm_id = get_perm_idnum( new_id_order ) ; 

  std::string perm_name =  get_comb_str( new_id_order );
  std::string sort_name =  get_comb_str( sort_options ) ;

  switch( sort_options_id ) {
    case 169 :
      switch( perm_id ) { 
      case 1 :
          sort_indices<0,1,0,1,1,1>( in, out, rlen->at(0), rlen->at(1) ); break; 
      case 2 :
          sort_indices<1,0,0,1,1,1>( in, out, rlen->at(0), rlen->at(1) ); break; 
      default:
        throw std::logic_error(" index permutation case " + perm_name + " not implemented for " + sort_name ) ;
      }
    case 170 :
      switch( perm_id ) { 
      case 1 :
          sort_indices<0,1,1,1,1,1>( in, out, rlen->at(0), rlen->at(1) ); break; 
      case 2 :
          sort_indices<1,0,1,1,1,1>( in, out, rlen->at(0), rlen->at(1) ); break; 
      default:
        throw std::logic_error(" index permutation case " + perm_name + " not implemented for " + sort_name ) ;
      }
    default:
      throw std::logic_error(" sort options case " + sort_name + " not implemented" ) ;
  }
  return;
}

